import{_ as e,c as t,a2 as r,o}from"./chunks/framework.DN5Ma_nw.js";const f=JSON.parse('{"title":"面试历程","description":"","frontmatter":{},"headers":[],"relativePath":"面试鸭/面试问/index.md","filePath":"面试鸭/面试问/index.md","lastUpdated":1733132188000}'),n={name:"面试鸭/面试问/index.md"};function i(d,a,l,p,s,h){return o(),t("div",null,a[0]||(a[0]=[r('<h1 id="面试历程" tabindex="-1">面试历程 <a class="header-anchor" href="#面试历程" aria-label="Permalink to &quot;面试历程&quot;">​</a></h1><p>在面试的过程中，我遇到了很多相对来说不怎么好的公司与面试官，例如刷KPI、重复询问八股文、答非所问等。</p><p>但是在面试途中也遇到几个厉害的面试官与公司，因此特定开辟一个模块，用于记录在面试时遇到的面试官与他们提问的问题。</p><h2 id="印萌" tabindex="-1"><a href="/blog/面试鸭/面试问/印萌.html">印萌</a> <a class="header-anchor" href="#印萌" aria-label="Permalink to &quot;[印萌](/面试鸭/面试问/印萌)&quot;">​</a></h2><p>一开始面试时面试官从 HTML 和 CSS 问起，我还以为又是一个问前端八股文的公司。没想到越到后面他的问题越有针对性。无论一面还是二面，都是如此。因此对他们肃然起敬。</p><p>最后面试结果通过了，不过由于 offer 冲突不得不放弃，HR 还和我说技术官对我技术持肯定态度，还让我再考虑一下。这番话对找了三个月工作、经历了不少公司打压、不少面试官或HR冷眼的我无疑是一个重大的肯定和鼓励，也让我更加有信心。十分感谢他们的肯定。</p><h2 id="百度" tabindex="-1"><a href="/blog/面试鸭/面试问/百度.html">百度</a> <a class="header-anchor" href="#百度" aria-label="Permalink to &quot;[百度](/面试鸭/面试问/百度)&quot;">​</a></h2><p>在最开始接到第三方外包的信息，说百度有一个面试机会时，我是惊讶的，也为此做了很多准备。</p><p>面试总共三轮，第一第二轮分别都问了 CSS 、JS、Vue、Promise等知识点，第三轮着重投屏敲代码证明实践能力。最终面试通过了，选择入职。</p><p>现在来补充一下面试的过程以及感悟。</p>',10)]))}const m=e(n,[["render",i]]);export{f as __pageData,m as default};
